import React from 'react';
const Header: React.FC = () => (
    <header style={{ 
      backgroundColor: 'green', 
      color: 'white', 
      textAlign: 'center', 
      padding: '1px',
      fontSize: '20px',
      marginBottom: '20px'
       }}>
      <img src="./prof.png" alt="Header Image" style={{ maxWidth: '100%' }} />
      <h1>POCKET PROFESSOR</h1>
    </header>
  );
  
  export default Header;
